import "./Style.css";
import logoInstagram from "../../img/instagram.png"

function ProfileCard({ name, description, instagram, instagram_url, imgProfile }) {
  return (
    <div className="profilecard">
      <div className="div-imgProfile">
        <img className="imgProfile" src={imgProfile} alt="" />
      </div>
      <div>
        <p>{name}{description}</p>
        <p><img className="social-media-icon" src="https://img.icons8.com/windows/32/000000/instagram-new.png" alt=""/><a target="_blank" rel="noreferrer" href={instagram_url}>{instagram}</a></p>
      </div>

    </div>
  );
}

export default ProfileCard;
